Club de Beauté is a set of hand-crafted NFTs representing a new generation of women exploring  adventure in the crypto jungle. We are fashion-oriented, multicultural, multifaceted; we embrace technology, enjoy e-Sports, look forward to the metaverse; 

To be fully transparent, we made a decision and reduced down the collection size from 2999 to 699 pieces as Genesis Collection and have burned 2300 tokens, here is the online transaction: https://etherscan.io/tx/0x82bdb0001dd7a9d8eb6adede3d20e39d545daeaddc94d6f60a6a5960d252e1d6

https://clubdebeaute.io/

The Imps are 10.000 randomly generated, animated, 3D characters on the Ethereum blockchain. Each one is completely unique but some are more rare than others. Each trait is handcrafted by SuperNfty in his signature floaty style.

Check out the [Genesis collection](https://opensea.io/collection/super-nfty-floating-heads), the [Superballs](https://opensea.io/collection/superballsnft), the [Rarity page](https://rarity.tools/imps-by-supernfty) and read more about SuperNfty on [Supernfty.com](https://www.supernfty.com/) or [Impsnft.com](https://www.impsnft.com/). Join the [Discord](https://discord.gg/supernfty), talk to other collectors and join the owners-exclusive chatrooms:
@SuperNfty On [Twitter](https://twitter.com/SuperNfty) and [Instagram](https://www.instagram.com/supernfty/)

Colonists are an NFT collection of 25,000 uniquely generated space animals, redeemable for a playable character and cosmetic items in our upcoming MMO on the blockchain Colony Online. 

There are 5 species of Colonists; Bears, Apes, Ducks, Cats and Dogs. Each species is dropped one by one, in batches of 5,000 during our minting phase. Minting your Colonists gives you completely randomized traits when it comes to fur color, hats, space suits etc;

For additional info on this collection visit: [https://www.colony.online/](https://www.colony.online/)
